import { Box, Center, Grid } from "@chakra-ui/layout";

function Calandre(rowNumber) {
  const Hours = [
    "00:00",
    "01:00",
    "02:00",
    "03:00",
    "04:00",
    "05:00",
    "06:00",
    "07:00",
    "08:00",
    "09:00",
    "10:00",
    "11:00",
    "12:00",
    "13:00",
    "14:00",
    "15:00",
    "16:00",
    "17:00",
    "18:00",
    "19:00",
    "20:00",
    "21:00",
    "22:00",
    "23:00",
  ];
  const loop = (x) => (f) => {
    if (x > 0) {
      f();
      loop(x - 1)(f);
    }
  };
  return (
    <Grid templateColumns="repeat(5, 1fr)" gap={1}>
      <Box w="100%" bg="blue.500">
        <Center h="160px" bg="red.500">
          /
        </Center>
        {Hours.map((value) => (
          <Center h="160px" fontSize="20px">
            {value}
          </Center>
        ))}
      </Box>
      {rowNumber}
    </Grid>
  );
}

export default Calandre;
